    - type: Paper
      content: >2-

                                        Ирина Расшивалова

        Нет ничего, что б было постоянным.

        Сменяют дни друг друга, даты, люди…

        И нам ничто не кажется в том странным,

        И по-другому ничего не будет…

        Мы все привыкли: всё пройдёт однажды,

        Неважно что: хорошее, плохое,

        Ничто не повторится в жизни дважды,

        Быть может к счастью, а быть может к горю…

        А ведь порой хотелось бы вернуться

        В какое-то мгновенье жизни этой,

        Ведь в памяти мгновенья остаются,

        Пусть даже и казались, что нелепы …

        Что постоянно в жизни – только память,

        Она одна с рожденья и до смерти,

        В ней всё, о чём когда-то нам мечталось,

        Что было с нами в этой круговерти.

        Она одна, советчик и учитель,

        Она всё знает и про нас всё помнит,

        Она наш рай порой и наш мучитель,

        Который и поддержит нас и сломит…

        Лишь память в этом мире постоянна,

        Она всегда способна только быть,

        Она одна ни в чём нас не обманет,

        Но не позволит ничего забыть.
